import React from "react";

const Portfolio = () => {
  return (
    <div>
      <div class="uk-flex uk-flex-center">
        <div class="uk-flex uk-flex-right@m uk-flex-right@l">
          <div className="portOne">
            The Eliza Kelley Project
          </div>
        </div>
      </div>
    </div>
  );
};

export default Portfolio;
